// SPDX-License-Identifier: MIT
pragma solidity >0.6.1;
pragma experimental ABIEncoderV2;

import "./uniswapv2/libraries/TransferHelper.sol";
import "./uniswapv2/UniswapV2ERC20.sol";
import "./uniswapv2/libraries/UniswapV2Library.sol";
import "./uniswapv2/interfaces/IUniswapV2Pair.sol";

interface IUniswapV2Router02 {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function getAmountsOut(uint256 amountIn, address[] calldata path)
        external
        view
        returns (uint256[] memory amounts);

    function getAmountsIn(uint256 amountOut, address[] calldata path)
        external
        view
        returns (uint256[] memory amounts);
}

contract PaymentContract {

struct StableCoinStruct {
        string symbol;
        bool isActive;
        bool isDefault;
        address stableCoinAddress;
        uint256 ratio;
        bool initialized;
    }

    address public owner;
    address public swapRouter;
    address public WBNB;
    address public stableCoinDefault;
    StableCoinStruct public stableCoinDefaultObj;
    uint256 public slippage;
    // UniswapV2ERC20 stableCoinContract;

    // mapping(string => address) public stableCoins;



    mapping(string => StableCoinStruct) public stableCoins;
    mapping(string => address) public stableCoinAddresses;

    string[] public stableCoinsList;

    function getStableCoinsList() public view returns (string[] memory) {
        return stableCoinsList;
    }

    // Defining the vendors array
    //struct vendor {
    //    string vendorName;
    //    uint vendorBalance;
    //}

    struct vendor {
        string vendorName;
        mapping(string => uint256) vendorBalance;
        bool isValid;
    }

    //vendor[] public vendors;

    mapping(string => vendor) public vendors;

    modifier onlyOwner() {
        require(msg.sender == owner, "only owner can call this function!");
        _;
    }

    // Events
    event paymentSuccessful(
        string _transactionId,
        uint256 _amountInUSD,
        string _vendorId,
        string _fiatSymbol,
        uint256 _fiatAmount,
        address buyer,
        uint256 _timestamp
    );

    event newVendorRegistered(string name, string _vendorId);
    event updatedRouter(address _previousRouter, address _newRouter);
    event stableCoinDefaultSet(
        address _previousStableCoinAddress,
        address _newStableCoinAddress,
        string _newStableCoinSymbol
    );
    event updatedSlippage(uint256 _previousSlippage, uint256 _newSlippage);
    event swapSuccessful(
        uint256 _tokenAmount,
        uint256 _amountInUSD,
        uint256[] amountOut,
        string _tokenSymbol,
        string _stableCoinSymbol,
        address buyer,
        string _transactionId
    );
    event tradeSuccessful(
        string _vendorId,
        string _transactionId,
        string _tradeId,
        address _traderAddress,
        uint256 _amount,
        string _stableCoinSymbol,
        string _traderEmail,
        uint256 _tradePrice,
        uint256 _timestamp
    );

    event addedStableCoin(
        string _newStableCoinSymbol,
        address _newStableCoinAddress
    );

    event disabledStableCoin(
        string _stableCoinSymbol,
        address _stableCoinAddress
    );

    event enabledStableCoin(
        string _stableCoinSymbol,
        address _stableCoinAddress
    );

    event ownershipTransferred(address _previousOwner, address _newOwner, uint256 _timestamp);

    event unregisteredStableCoin(
        string _unregisteredStableCoinSymbol,
        address _defaultStableCoinAddress
    );

    constructor(
        address _swapRouter,
        address _WBNB,
        //address _stableCoin,
        string memory _stableCoinSymbol,
        address _stableCoinAddress,
        uint256 _slippage
    ) public {
        swapRouter = _swapRouter;
        WBNB = _WBNB;
        // this.addStableCoin((_stableCoinSymbol), _stableCoinAddress);
        // // stableCoins[_stableCoinSymbol] = _stableCoinAddress;
        // // stableCoinsList.push(StableCoinStruct(_stableCoinSymbol, true));
        // //stableCoin = _stableCoin;
        // stableCoinContract = UniswapV2ERC20(stableCoin);

        stableCoinDefault = _stableCoinAddress;
        stableCoinDefaultObj = StableCoinStruct(
        	_stableCoinSymbol,
          true,
          true,
          _stableCoinAddress,
          1,
          true
        );

        emit stableCoinDefaultSet(address(0), _stableCoinAddress, _stableCoinSymbol);

        stableCoinAddresses[_stableCoinSymbol] = _stableCoinAddress;
        stableCoinsList.push(_stableCoinSymbol);
        stableCoins[_stableCoinSymbol] = stableCoinDefaultObj;
        slippage = _slippage;
        owner = msg.sender;
    }

    function setRouter(address _swapRouter, address _WBNB) public onlyOwner {
        address _previousRouter = swapRouter;
        swapRouter = _swapRouter;
        WBNB = _WBNB;
        emit updatedRouter(_previousRouter, _swapRouter);
    }

    function setStableCoinDefault(string memory _stableCoinSymbol)
        public
        onlyOwner
    {

        require(
            stableCoins[_stableCoinSymbol].initialized == true,
            "this stable coin is not allowed!"
        );

        stableCoinDefaultObj.isDefault = false;

        address _previousStableCoin = stableCoinDefault;

        stableCoinDefault = stableCoins[_stableCoinSymbol].stableCoinAddress;
        stableCoinDefaultObj = stableCoins[_stableCoinSymbol];  
        stableCoinDefaultObj.isDefault = true;

        // stableCoinContract = UniswapV2ERC20(stableCoin);
        emit stableCoinDefaultSet(_previousStableCoin, stableCoinDefault, _stableCoinSymbol);
    }

    // function setStableCoinDefault(address _stableCoin) public onlyOwner {
    //     address _previousStableCoin = stableCoinDefault;
    //     stableCoinDefault = _stableCoin;
    //     // stableCoinContract = UniswapV2ERC20(stableCoin);
    //     emit updatedStableCoin(_previousStableCoin, _stableCoin);
    // }

    function setSlippage(uint256 _slippage) public onlyOwner {
        uint256 _previousSlippage = slippage;
        slippage = _slippage;
        emit updatedSlippage(_previousSlippage, _slippage);
    }

    /*
   function registerANewVendor(string memory _name) public onlyOwner returns(uint){
        uint _Id = vendors.length - 1;
        vendor memory newVendor;
        newVendor.vendorName = _name;
        newVendor.vendorBalance = 0;

        vendors.push(newVendor);
        emit newVendorRegistered(_name, _Id);
        return _Id;
    }
**/

    function registerANewVendor(string memory _name, string memory _vendorId)
        public
        onlyOwner
    {
        // uint _Id = vendors.length - 1;
        vendor memory newVendor;
        newVendor.vendorName = _name;
        newVendor.isValid = true;
        // newVendor.vendorBalance[stableCoinContract.symbol()] = 0;

        // vendors.push(newVendor);
        vendors[_vendorId] = newVendor;

        emit newVendorRegistered(_name, _vendorId);
    }

    function vendorBalance(
        string memory vendorId,
        string memory stableCoinSymbol
    ) public view returns (uint256) {
        require(vendors[vendorId].isValid == true, "vendor does not exist!");
        return vendors[vendorId].vendorBalance[stableCoinSymbol];
    }

    // Allows a buyer to make payment
    function makePayment(
        string memory _vendorId,
        address _token,
        uint256 _amountInUSD,
        string memory _fiatSymbol,
        uint256 _fiatAmount,
        string memory _tokenSymbol,
        string memory _transactionId,
        string memory _stableCoinSymbol
    ) public {
        require(vendors[_vendorId].isValid == true, "vendor does not exist!");

        require(
            _amountInUSD > 0 && _fiatAmount > 0,
            "provide an amount greater than zero!"
        );

        // Always take WBNB path to get a better rate
        address[] memory _path;

        /*
        if (_token == WBNB) {
             _path = new address[](2);
            _path[0] = _token;
            _path[1] = stableCoin;
        } else{
            _path = new address[](3);
            _path[0] = _token;
            _path[1] = WBNB;
            _path[2] = stableCoin;
        }
        **/

        // require(
        //     stableCoins[_stableCoinSymbol].isActive == true,
        //     "this stable coin is deactivated for payments!"
        // );

        // stableCoin = stableCoins[_stableCoinSymbol].stableCoinAddress;
        address stableCoin;

        if (stableCoins[_stableCoinSymbol].isActive) {
            stableCoin = stableCoinAddresses[_stableCoinSymbol];
        } else {
            stableCoin = stableCoinDefault;
            // notify that unregistered stable coin was passed in for use but replaced with default
            unregisteredStableCoin(
                _stableCoinSymbol,
                stableCoinDefault
            );
        }

        _path = new address[](2);
        _path[0] = _token;
        _path[1] = stableCoin;

        // msg.sender must approve this contract to spend their tokens

        if (_token != stableCoin) {
            // Get the amount of token to swap
            uint256 _tokenAmount = _requiredTokenAmount(_amountInUSD, _path);

            // Takes the tokens from buyer account
            TransferHelper.safeTransferFrom(
                _token,
                msg.sender,
                address(this),
                _tokenAmount
            );

            // Swap to stableCoin
            uint256[] memory amountOut = _swap(
                _tokenAmount,
                _amountInUSD,
                _path
            );

            emit swapSuccessful(
                _tokenAmount,
                _amountInUSD,
                amountOut,
                _tokenSymbol,
                _stableCoinSymbol,
                msg.sender,
                _transactionId
            );
        } else {
            TransferHelper.safeTransferFrom(
                _token,
                msg.sender,
                address(this),
                _amountInUSD
            );
        }
        // Updates vendor's balance
        vendors[_vendorId].vendorBalance[_stableCoinSymbol] += _amountInUSD;

        // string memory _transactionId = _generateTransactionId(_vendorId);

        // emit payment recieve event
        emit paymentSuccessful(
            _transactionId,
            _amountInUSD,
            _vendorId,
            _fiatSymbol,
            _fiatAmount,
            msg.sender,
            block.timestamp
        );
    }

    // Internal funtions

    function _requiredTokenAmount(uint256 _amountInUSD, address[] memory _path)
        public
        view
        returns (uint256)
    {
        uint256[] memory _tokenAmount = IUniswapV2Router02(swapRouter)
            .getAmountsIn(_amountInUSD, _path);
        return _tokenAmount[0];
    }

    /*
    function _generateTransactionId(string memory _vendorID) public view returns(string memory){
        uint256 time = block.timestamp;
        uint256 exponent;
        while (time >= 10) {
            time /= 10;
            exponent++;
        }
        // uint _transactionID = _vendorID * 10 ** (exponent + 1) + block.timestamp;
        string memory _transactionID = _vendorID + block.timestamp;
        return _transactionID;
    }

    **/

    // Swap from tokens to a stablecoin
    function _swap(
        uint256 _tokenAmount,
        uint256 _amountInUSD,
        address[] memory _path
    ) internal returns (uint256[] memory amountOut) {
        // Approve the router to swap token.
        TransferHelper.safeApprove(_path[0], swapRouter, _tokenAmount);

        amountOut = IUniswapV2Router02(swapRouter).swapTokensForExactTokens(
            _amountInUSD,
            _tokenAmount + (slippage / 100) * _tokenAmount,
            _path,
            address(this),
            block.timestamp
        );

        // emit swapSuccessful(_tokenAmount, _amountInUSD, amountOut);
    }

    // SendTokens() is the function that releases the token to a trader
    // from is expected to be a vendor's ID
    function sendTokens(
        uint256 _amount,
        string memory _from,
        address _traderAddress,
        string memory _transactionId,
        string memory _tradeId,
        string memory _stableCoinSymbol,
        string memory _traderEmail,
        uint256 _tradePrice
    ) public onlyOwner {
        require(vendors[_from].isValid == true, "invalid vendor id!");
        require(
            _amount <= vendors[_from].vendorBalance[_stableCoinSymbol],
            "not enough balance!"
        );

        require(
            stableCoins[_stableCoinSymbol].isActive == true,
            "this stable coin is deactivated for payments!"
        );

        address stableCoin = stableCoins[_stableCoinSymbol].stableCoinAddress;

        vendors[_from].vendorBalance[_stableCoinSymbol] -= _amount;
        TransferHelper.safeTransfer(stableCoin, _traderAddress, _amount);

        emit tradeSuccessful(
            _from,
            _transactionId,
            _tradeId,
            _traderAddress,
            _amount,
            _stableCoinSymbol,
            _traderEmail,
            _tradePrice,
            block.timestamp
        );
    }

    // Need to check logic of this
    function _isEnoughLiquidity(
        address _token,
        address _stableCoin,
        uint256 _amountInUSD
    ) internal view returns (bool) {
        // Get reserve
        IUniswapV2Pair pair = IUniswapV2Pair(
            UniswapV2Library.pairFor(
                IUniswapV2Router02(swapRouter).factory(),
                _token,
                _stableCoin
            )
        );
        (uint256 reserves0, uint256 reserves1, ) = pair.getReserves();
        uint256 stableCoinReserve = _stableCoin == pair.token0()
            ? reserves0
            : reserves1;
        /* Check price impact
            if price impact is higher than slippage, then there is'nt enough liquidity for the trade
        */
        if (_amountInUSD / stableCoinReserve > slippage / 100) {
            return false;
        } else return true;
    }

    function addStableCoin(
        string memory _stableCoinSymbol,
        address _stableCoinAddress
    ) public onlyOwner {
        stableCoinAddresses[_stableCoinSymbol] = _stableCoinAddress;
        stableCoinsList.push(_stableCoinSymbol);
        stableCoins[_stableCoinSymbol] = StableCoinStruct(
            _stableCoinSymbol,
            true,
            false,
            _stableCoinAddress,
            0,
            true
        );

        emit addedStableCoin(_stableCoinSymbol, _stableCoinAddress);
    }

    function disableStableCoin(string memory _stableCoinSymbol)
        public
        onlyOwner
    {

    		require(
        	stableCoins[_stableCoinSymbol].isDefault == false,
        	"default stable coin cannot be deactivated!"
        );

        // StableCoinStruct memory sc = stableCoins[_stableCoinSymbol];
        stableCoins[_stableCoinSymbol].isActive = false;

        emit disabledStableCoin(
            _stableCoinSymbol,
            stableCoins[_stableCoinSymbol].stableCoinAddress
        );
    }

    function enableStableCoin(string memory _stableCoinSymbol)
        public
        onlyOwner
    {

    		require(
        	stableCoins[_stableCoinSymbol].isDefault == false,
        	"default stable coin cannot be deactivated!"
        );

        // StableCoinStruct memory sc = stableCoins[_stableCoinSymbol];
        stableCoins[_stableCoinSymbol].isActive = true;

        emit enabledStableCoin(
            _stableCoinSymbol,
            stableCoins[_stableCoinSymbol].stableCoinAddress
        );
    }

    function vendorBalanceFor(
        string memory _vendorId,
        string memory _stableCoinSymbol
    ) public view returns (uint256) {
        require(vendors[_vendorId].isValid == true, "vendor does not exist!");
        uint256 _balance = vendors[_vendorId].vendorBalance[_stableCoinSymbol];
        return _balance;
    }

    function totalVendorBalance(string memory _vendorId)
        public
        view
        returns (uint256)
    {
        require(vendors[_vendorId].isValid == true, "vendor does not exist!");
        uint256 _balance = 0;
        for (uint256 i = 0; i < stableCoinsList.length; i++) {
            _balance += vendorBalanceFor(_vendorId, stableCoinsList[i]);
        }
        return _balance;
    }

    function transferOwnershipTo(address _newOwner) public onlyOwner {
        address previousOwner = owner;
        owner = _newOwner;
        emit ownershipTransferred(previousOwner, owner, block.timestamp);
    }
}
